import Checkbox from ''
function Permission({ Menuitem }) {
  return (
    <tbody>
          <tr>
            <td>{Menuitem.title}</td>

            <td><Checkbox checked={Menuitem.permissionKey}/></td>
            <td>{Menuitem.edit}</td>
            <td>{Menuitem.remove}</td>
          </tr>
        </tbody>
  );
}
export default Permission;
